import React from 'react'
import { useBoardList } from '../queries/useBoardQueries'

const BoardList = () => {

  const { isLoading, error, data } = useBoardList();

  if (isLoading) return 'Loading....';

  if (error) return 'Error : ' + error.message; 

  return (
    <div>BoardList</div>
  )
}

export default BoardList
